import React, { useEffect, useState, useCallback, useMemo } from "react";
import { fetchAtivos } from "../services/ativoService";
import AtivoTableHeader from "./AtivoTableHeader";
import AtivoTableRow from "./AtivoTableRow";
import AtivoDetailModal from "./AtivoDetailModal";
import { formatDate } from "../utils/dateUtils";

const CATEGORIES = [
  { value: "todos", label: "Todas as Categorias" },
  { value: "Notebook", label: "Notebook" },
  { value: "Desktop", label: "Desktop" },
  { value: "Smartphone", label: "Smartphone" },
  { value: "Monitor", label: "Monitor" }
];

const AtivoList = () => {
  const [ativos, setAtivos] = useState([]);
  const [loading, setLoading] = useState(true);
  const [searchTerm, setSearchTerm] = useState("");
  const [selectedCategory, setSelectedCategory] = useState("todos");
  const [selectedAtivo, setSelectedAtivo] = useState(null);

  const loadAtivos = useCallback(async () => {
    try {
      setLoading(true);
      const response = await fetchAtivos();
      setAtivos(response.data);
    } catch (error) {
      console.error("Erro ao buscar ativos:", error);
    } finally {
      setLoading(false);
    }
  }, []);

  useEffect(() => {
    loadAtivos();
  }, [loadAtivos]);

  const filteredAtivos = useMemo(() => {
    return ativos.filter((ativo) => {
      const matchesSearch = [
        ativo.nome, 
        ativo.codigo_patrimonio, 
        ativo.categoria, 
        ativo.responsavel
      ].some(field => 
        field?.toLowerCase().includes(searchTerm.toLowerCase())
      );

      const matchesCategory = selectedCategory === "todos" || 
        ativo.categoria === selectedCategory;

      return matchesSearch && matchesCategory;
    });
  }, [searchTerm, selectedCategory, ativos]);

  const renderTableContent = () => {
    if (loading) {
      return (
        <tr>
          <td colSpan="8" className="text-center py-5">
            <div className="spinner-border text-primary" role="status">
              <span className="visually-hidden">Carregando...</span>
            </div>
          </td>
        </tr>
      );
    }

    if (filteredAtivos.length === 0) {
      return (
        <tr>
          <td colSpan="8" className="text-center py-4 text-muted">
            Nenhum ativo encontrado
          </td>
        </tr>
      );
    }

    return filteredAtivos.map((ativo) => (
      <AtivoTableRow 
        key={ativo.id} 
        ativo={ativo} 
        onView={() => setSelectedAtivo(ativo)}
        formatDate={formatDate}
      />
    ));
  };

  return (
    <div className="container mt-4">
      <div className="card shadow-sm">
        <AtivoTableHeader
          categories={CATEGORIES}
          selectedCategory={selectedCategory}
          onCategoryChange={setSelectedCategory}
          searchTerm={searchTerm}
          onSearchChange={setSearchTerm}
        />

        <div className="card-body p-0">
          <div className="table-responsive">
            <table className="table table-hover mb-0 align-middle">
              <thead>
                <tr className="bg-light">
                  <th>Nome do Ativo</th>
                  <th>Patrimônio</th>
                  <th>Categoria</th>
                  <th>Responsável</th>
                  <th>Setor</th>
                  <th>Última Avaliação</th>
                  <th>Próxima Avaliação</th>
                  <th>Ações</th>
                </tr>
              </thead>
              <tbody>
                {renderTableContent()}
              </tbody>
            </table>
          </div>
        </div>
      </div>

      <AtivoDetailModal 
        ativo={selectedAtivo} 
        onClose={() => setSelectedAtivo(null)} 
      />
    </div>
  );
};

export default AtivoList;
